import React, { Component } from 'react';

class Card extends Component {
  render() {
    return (

      <div className="flip-card">
                <div className="flip-card-inner">
                  <div className="flip-card-front">
                    <i className="fas fa-heart fa-6x"><p className="carousel-title">Råvaror</p></i>
                  </div>
                  <div className="flip-card-back">
                    <h1>Råvaror</h1> 
                    <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. 
                    Consequuntur inventore dolorum nulla, ad vel dolor ex! 
                    Assumenda quaerat tenetur delectus, nostrum temporibus! 
                    </p> 
                  </div>
                </div>
              </div>

      )
  }
}

export default Card;
